import { connect } from "react-redux";
import { Link } from 'react-router-dom';
import './home.scss';

const HomeFooter = (props) => {
    return (
        <footer className="home_footer">
                <div id="logo_in_home_footer" ></div>
                <div id="contact_us"><p>CONTACT US</p></div>
                <div id="menu_footer">
                    <Link to={"/home"}><p className="menu_footer_link">HOME</p></Link>
                    <Link to={"/home"}><p className="menu_footer_link">AUCTIONS</p></Link>
                    <Link to={"/home"}><p className="menu_footer_link">BUILDING</p></Link>
                    <Link to={"/home"}><p className="menu_footer_link">ABOUT</p></Link>
                </div>
                <div id="text_footer">
                    <p>  Building Chinese auctions,<br />
                        And a database of all sales built.<br />
                        The site is used by the masses<br />
                        And is gaining momentum among the general public.<br />
                        The site has gained worldwide publicity<br />
                        Thanks to its uniqueness.
                    </p>
                </div>
        </footer>
    );
}
const mapStateToProps = (state) => {
    return {

    }
}

export default connect(mapStateToProps, {})(HomeFooter);
